import { Paper } from '@material-ui/core';
import React from 'react';
import FacebookIcon from '@material-ui/icons/Facebook';

const JoinCard = (props) => {
    return(
        <>
        <Paper elevation={3}>
            <FacebookIcon/>
        </Paper>
        </>
    )
}

export default JoinCard
